// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "../interfaces/ITableManager.sol";
import "../interfaces/IOrderManager.sol";
import "../access/RoleAccess.sol";

contract TableManager is ITableManager {
    IOrderManager public orderManager;
    RoleAccess public roleAccess;

    uint256 public nextTableId = 1;
    mapping(uint256 => Table) public tables;

    mapping(uint256 => uint256[]) public orderTable;

    constructor(address _roleAccess) {
        roleAccess = RoleAccess(_roleAccess);
    }

    modifier onlyAdmin() {
        require(roleAccess.hasRole(tx.origin,RoleType.ADMIN), "Not admin");
        _;
    }

    modifier onlyAdminOrStaff() {
        require(
            roleAccess.hasRole(tx.origin, RoleType.ADMIN) ||
                roleAccess.hasRole(tx.origin, RoleType.STAFF),
            "Not admin or staff"
        );
        _;
    }
    function setOrderManager(address _orderManager) external override {
        orderManager = IOrderManager(_orderManager);
    }

    function addTable(
        uint256 _row,
        uint256 _col,
        string memory _qrUrl
    ) external override onlyAdmin returns (uint256) {
        require(_row > 0 && _col > 0, "Row and column must be greater than 0");
        require(bytes(_qrUrl).length > 0, "QR URL cannot be empty");
        uint256 newTableId = nextTableId++;
        tables[newTableId] = Table({
            tableId: newTableId,
            row: _row,
            col: _col,
            qrUrl: _qrUrl,
            status: TableStatus.Free
        });
        emit TableAdded(newTableId, _row, _col);
        return newTableId;
    }

    function updateTable(
        uint256 _tableId,
        uint256 _row,
        uint256 _col,
        string memory _qrUrl
    ) external onlyAdmin {
        require(tables[_tableId].tableId != 0, "Table does not exist");

        Table storage table = tables[_tableId];
        table.row = _row;
        table.col = _col;

        // Update qrUrl only if a non-empty string is provided
        if (bytes(_qrUrl).length > 0) {
            table.qrUrl = _qrUrl;
        }

        emit TableUpdated(_tableId, table.row, table.col, table.qrUrl);
    }

    function editTable(
        uint256 _tableId,
        uint256 _row,
        uint256 _col
    ) external override onlyAdmin {
        require(tables[_tableId].tableId != 0, "Table does not exist");
        require(_row > 0 && _col > 0, "Row and column must be greater than 0");
        tables[_tableId].row = _row;
        tables[_tableId].col = _col;
        emit TableEdited(_tableId, _row, _col);
    }

    function deleteTable(uint256 _tableId) external override {
        require(tables[_tableId].tableId != 0, "Table does not exist");
        delete tables[_tableId];
        emit TableDeleted(_tableId);
    }

    function getTableById(uint256 _tableId)
        external
        view
        override
        returns (Table memory)
    {
        require(tables[_tableId].tableId != 0, "Table does not exist");
        return tables[_tableId];
    }

    function addTableToOrder(uint256 _orderId, uint256 _tableId)
        external
        override
        onlyAdmin
    {
        require(tables[_tableId].tableId != 0, "Table ID does not exist");
        orderManager.addTableForOrder(_orderId, _tableId);
        emit TableAddedToOrder(_tableId, _orderId);
    }

    function updateStatusTable(uint256 _tableId, TableStatus _status)
        external
        override
        onlyAdminOrStaff
    {
        require(tables[_tableId].tableId != 0, "Table ID does not exist");
        tables[_tableId].status = _status;
        emit TableUpdatedStaus(_tableId);
    }
}

contracts/access/RoleAccess.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../structs/RoleStruct.sol";

contract RoleAccess {
    address public owner;

    mapping(address => Role) private userRole; // danh sách user đã cấp quyền
    mapping(uint256 => Role) private roles; // danh sách các role
    uint256[] private arrRoles; // danh sách các roleId

    event RoleAssigned(
        address indexed account,
        string roleName,
        RoleType roleType
    );
    event RoleUpdated(
        address indexed account,
        string roleName,
        RoleType roleType
    );
    event RoleRevoked(address indexed account);

    constructor() {
        owner = msg.sender;
        // Init 2 default roles
        roles[1] = Role(1, RoleType.ADMIN, "Administrator");
        arrRoles.push(1);
        roles[2] = Role(2, RoleType.STAFF, "Staff");
        arrRoles.push(2);
    }

    // 2. Gán Role cho user
    function assignRole(address account, uint256 roleId) external {
        require(roles[roleId].roleId != 0, "Invalid role ID");
        userRole[account] = roles[roleId];
        emit RoleAssigned(account, roles[roleId].name, roles[roleId].role);
    }

    // // 3. Cập nhật Role của user
    // function updateUserRole(address account, uint256 newRoleId) external onlyOwner {
    //     require(roles[newRoleId].roleId != 0, "Invalid role ID");
    //     require(userRole[account].roleId != 0, "User does not have a role");
    //     userRole[account] = roles[newRoleId];
    //     emit RoleUpdated(account, roles[newRoleId].name, roles[newRoleId].role);
    // }

    // 4. Thu hồi Role của user
    function revokeRole(address account) external  {
        require(userRole[account].roleId != 0, "User has no role assigned");
        delete userRole[account];
        emit RoleRevoked(account);
    }

    // 5. Lấy Role của user
    function getUserRole(address account) external view returns (Role memory) {
        require(userRole[account].roleId != 0, "User has no role assigned");
        return userRole[account];
    }

    // 7. Lấy tất cả Role
    function getAllRoles() external view returns (Role[] memory) {
        Role[] memory allRoles = new Role[](arrRoles.length);
        for (uint i = 0; i < arrRoles.length; i++) {
            allRoles[i] = roles[arrRoles[i]];
        }
        return allRoles;
    }

    // 8. Kiểm tra user có Role cụ thể không
    function hasRole(address account, RoleType roleType) external view returns (bool) {
        if(userRole[account].roleId == 0){
            return false;
        } 
        return userRole[account].role == roleType;
    }

    function getOwner() external view returns (address) {
        return owner;
    }
}

